import React, { useState, useEffect } from 'react';

const AppointmentRequest = () => {

    const [items, setItems] = useState([]);
  const [loading, setLoading] = useState(true); 
  const [error, setError] = useState(null); 

  useEffect(() => {
    const page = 1; 
    const pageSize = 7;
    fetch(`https://localhost:7169/api/Appointment?page=${page}&page_size=${pageSize}`)
      .then(response => {
        if (!response.ok) { 
          throw new Error('Network response was not ok');
        }
        return response.json();
      })
      .then(data => {
        setItems(data);
        setLoading(false); 
      })
      .catch(error => {
        console.error('Error fetching data:', error);
        setError(error); 
        setLoading(false);
      });
  }, []);

  if (loading) {
    return <div>Loading...</div>; 
  }

  if (error) {
    return <div>Error: {error.message}</div>; 
  }

    return (
        <div>
            <div className=" bg-cyan-700 h-screen w-screen flex items-center justify-center">
                <div className="bg-gray-200 w-2/6 min-w-[400px] h-5/6 pt-16 pr-8 pl-8 pb-8 ">
                    <div className= "top-20">
                        <text className="text-xl font-bold">Appoitment Request</text>
                        
                        <button className="pt-2 pb-2 pr-4 pl-4 ">
                            <span className="ml-40 flex items-center text-cyan-500 font-medium">
                                View All
                                <img 
                                className="w-4 h-4 ml-2" 
                                src="https://img.icons8.com/ios-glyphs/30/22C3E6/more-than.png" 
                                alt="more than icon" 
                                aria-hidden="true" 
                                />
                            </span>
                        </button>
                    </div>

                    <div className="bg-grey-50 pt-4 pl-4 pr-4 w-full h-full">
                        <div className="">
                            
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
  };
  
  export default AppointmentRequest;
